import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const UserProfilePage = () => {
  const [activeTab, setActiveTab] = useState('profile');
  const [profile, setProfile] = useState({
    name: 'John Doe',
    email: 'john@example.com',
    bio: 'Knowledge enthusiast',
    notificationsEnabled: true,
  });

  // Sample saved items data
  const [savedItems] = useState([
    { id: 1, title: 'JavaScript Best Practices', type: 'article' },
    { id: 2, title: 'React Hooks Tutorial', type: 'video' },
    { id: 3, title: 'CSS Grid Guide', type: 'article' },
  ]);

  // Sample notifications data
  const [notifications] = useState([
    { id: 1, text: 'Your article was approved', read: true },
    { id: 2, text: 'New comment on your post', read: false },
    { id: 3, text: 'Weekly newsletter', read: false },
  ]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setProfile(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert('Profile updated successfully!');
  };

  // Function to mark notification as read
  const markAsRead = (id) => {
    alert(`Marked notification ${id} as read`);
  };

  return (
    <div className="profile-container">
      <div className="profile-header">
        <div className="avatar-large">ðŸ‘¤</div>
        <h2>User Profile</h2>
      </div>

      {/* Tab Navigation */}
      <div className="tabs">
        <button 
          className={`tab ${activeTab === 'profile' ? 'active' : ''}`}
          onClick={() => setActiveTab('profile')}>
          Profile
        </button>
        <button 
          className={`tab ${activeTab === 'saved' ? 'active' : ''}`}
          onClick={() => setActiveTab('saved')}>
          Saved Items
        </button>
        <button 
          className={`tab ${activeTab === 'notifications' ? 'active' : ''}`}
          onClick={() => setActiveTab('notifications')}>
          Notifications
        </button>
      </div>

      {/* Tab Content */}
      <div className="tab-content">
        {activeTab === 'profile' && (
          <form onSubmit={handleSubmit} className="profile-form">
            <div className="form-group">
              <label>Display Name</label>
              <input 
                type="text" 
                name="name"
                value={profile.name}
                onChange={handleChange}
                className="form-control"
              />
            </div>

            <div className="form-group">
              <label>Email</label>
              <input 
                type="email" 
                name="email"
                value={profile.email}
                onChange={handleChange}
                className="form-control"
                disabled
              />
            </div>

            <div className="form-group">
              <label>Bio</label>
              <textarea 
                name="bio"
                value={profile.bio}
                onChange={handleChange}
                className="form-control"
                rows="3"
              />
            </div>

            <div className="form-group checkbox-group">
              <input 
                type="checkbox" 
                id="notificationsEnabled" 
                name="notificationsEnabled"
                checked={profile.notificationsEnabled}
                onChange={handleChange}
              />
              <label htmlFor="notificationsEnabled">Email notifications</label>
            </div>

            <div className="form-actions">
              <button type="submit" className="btn btn-primary">Save Changes</button>
              <button type="button" className="btn btn-secondary">Cancel</button>
            </div>
          </form>
        )}

        {activeTab === 'saved' && (
          <div className="saved-items">
            <h3>Your Saved Items</h3>
            {savedItems.length === 0 ? (
              <p>No saved items found</p>
            ) : (
              <ul className="saved-list">
                {savedItems.map(item => (
                  <li key={item.id} className="saved-item">
                    <span className={`item-icon ${item.type}`}>
                      {item.type === 'video' ? 'â–¶' : 'ðŸ“„'}
                    </span>
                    <span className="item-title">{item.title}</span>
                    <button className="btn btn-sm btn-outline">View</button>
                  </li>
                ))}
              </ul>
            )}
          </div>
        )}

        {activeTab === 'notifications' && (
          <div className="notifications">
            <h3>Notifications</h3>
            {notifications.length === 0 ? (
              <p>No notifications</p>
            ) : (
              <ul className="notification-list">
                {notifications.map(notification => (
                  <li 
                    key={notification.id} 
                    className={`notification-item ${notification.read ? 'read' : 'unread'}`}
                  >
                    <span className="notification-text">{notification.text}</span>
                    {!notification.read && (
                      <button 
                        className="btn btn-sm btn-primary"
                        onClick={() => markAsRead(notification.id)}
                      >
                        Mark as read
                      </button>
                    )}
                  </li>
                ))}
              </ul>
            )}
            <div className="notification-settings">
              <label>
                <input 
                  type="checkbox" 
                  checked={profile.notificationsEnabled}
                  onChange={(e) => setProfile(prev => ({
                    ...prev, 
                    notificationsEnabled: e.target.checked
                  }))}
                />
                Enable email notifications
              </label>
            </div>
          </div>
        )}
      </div>

      <Link to="/" className="dashboard-link">
        Back to Dashboard
      </Link>
    </div>
  );
};

export default UserProfilePage;
